import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';
import { BASE_URL } from "/Users/tunjung/coding/MemoRide-SBD/frontend/src/utils/config.js";
import { Provider } from 'react-redux';
import { createStore } from 'redux';
import rootReducer from './';

import App from './App';
import "bootstrap/dist/css/bootstrap.min.css";
import "remixicon/fonts/remixicon.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import { BrowserRouter } from "react-router-dom";

axios.defaults.baseURL = BASE_URL;

const store = createStore(rootReducer); // Create your Redux store with the root reducer

const root = document.getElementById('root');

ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}> {/* Wrap your app with the Provider component */}
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </Provider>
  </React.StrictMode>,
  root
);

